import React from "react";
import ContactCommand from "./ContactCommand";
import ContactSort from "./ContactSort";
import ContactAdd from "./ContactAdd";

const Contact = () => {
    return (
        <div className="contact">
            <ContactCommand />
            <ContactList />
        </div>
    );
}







const ContactList = () => {
    return (
        <div className="contact-inner">
            <div className="wrapperTable">
                <ContactDiv />
            </div>
        </div>
    );
}

const ContactDiv = () => {
    return (
        <table className="contact-list">
            <HeaderInfoLine />
            <InfoLine
                userName={"Judith Williams"}
                email={"judith.williams@gmail.com"}
                companyName={"Google"}
                role={"Designer"}
                forecast={"45 %"}
                date={"Nov 26, 2018"}
            />
            <InfoLine
                userName={"Lindsey Stroud"}
                email={"lindsey.stroud@gmail.com"}
                companyName={"Hatchbuck"}
                role={"Manager"}
                forecast={"50 %"}
                date={"5 Minutes ago"}
            />
            <InfoLine
                userName={"Nicci Troiani"}
                email={"nicci.troiani@gmail.com"}
                companyName={"Slack"}
                role={"Manager"}
                forecast={"75 %"}
                date={"14 Minutes ago"}
            />
            <InfoLine
                userName={"George Fields"}
                email={"george.fields@gmail.com"}
                companyName={"Clockify"}
                role={"CEO"}
                forecast={"10 %"}
                date={"6 Hours ago"}
            />
            <InfoLine
                userName={"Rebecca Moore"}
                email={"rebecca.moore@gmail.com"}
                companyName={"Upwork"}
                role={"Manager"}
                forecast={"25 %"}
                date={"Dec 14, 2018"}
            />
            <InfoLine
                userName={"Jane Doe"}
                email={"jane.doe@gmail.com"}
                companyName={"Trello"}
                role={"Engineer"}
                forecast={"30 %"}
                date={"Dec 12, 2018"}
            />
            <InfoLine
                userName={"Jones Dermot"}
                email={"dermot.jones@gmail.com"}
                companyName={"Slack"}
                role={"Developer"}
                forecast={"40 %"}
                date={"Dec 11, 2018"}
            />
            <InfoLine
                userName={"Martin Merces"}
                email={"martin.merces@gmail.com"}
                companyName={"Google"}
                role={"Manager"}
                forecast={"60 %"}
                date={"Dec 9, 2018"}
            />
            <InfoLine
                userName={"Franz Ferdinand"}
                email={"franz.ferdiand@gmail.com"}
                companyName={"Facebook"}
                role={"Manager"}
                forecast={"100 %"}
                date={"Dec 6, 2018"}
            />
            <InfoLine
                userName={"John Smith"}
                email={"john.smith@gmail.com"}
                companyName={"Skype"}
                role={"CEO"}
                forecast={"75 %"}
                date={"Nov 30, 2018"}
            />
        </table>
    );
}

const HeaderInfoLine = () => {
    return (
        <tr className="header-line">
            <th className="row-space">
                <form className="row-space-cbx">
                    <input type="checkbox" className="form__cbx countTask" id="checkbox" /><label
                    htmlFor="checkbox"></label>
                </form>
            </th>
            <th className="nohide hide">
                <div className="wrapperSpan">
                    <span className="selectedInfo">Selected</span>
                    <span className="deleteted-box">
                                                <svg width="16" height="16" viewBox="0 0 16 16" fill="none"
                                                     xmlns="http://www.w3.org/2000/svg">
                                                    <path className="deletCbx"
                                                          d="M3.99998 12.6667C3.99998 13.4 4.59998 14 5.33331 14H10.6666C11.4 14 12 13.4 12 12.6667V4.66667H3.99998V12.6667ZM12.6666 2.66667H10.3333L9.66665 2H6.33331L5.66665 2.66667H3.33331V4H12.6666V2.66667Z"
                                                          fill="#C2CFE0"/>
                                                </svg>
                                            </span>
                </div>
            </th>
            <th className="row-1 header-text hideElement">
                <div className="list-header__name">Name</div>
            </th>
            <th className="row-1 header-text hideElement">
                <div className="list-header__email">Email</div>
            </th>
            <th className="row-1 header-text hideElement">
                <div className="list-header__compname">Company name</div>
            </th>
            <th className="row-1 header-text hideElement">
                <div className="list-header__role">Role</div>
            </th>
            <th className="row-1 header-text hideElement">
                <div className="list-header__forecast">Forecast</div>
            </th>
            <th className="header-text last__td hideElement">Recent activity</th>
        </tr>
    );
}

const InfoLine = (props) => {
    return (
        <tr className="info-line">
            <td>
                <form className="row-space-cbx">
                    <input type="checkbox" className="form__cbx chield" id="checkbox10"/><label
                    htmlFor="checkbox10"></label>
                </form>
            </td>
            <td className="profile__name">
                <div className="list-padding: 0px 24px 0px 24px;header-photo"><img
                    className="mini__photo" src="../../assets/image%203.png" alt=""/></div>
                <div className="list-header__name">{props.userName}</div>
            </td>
            <td>{props.email}</td>
            <td>{props.companyName}</td>
            <td>{props.role}</td>
            <td>{props.forecast}</td>
            <td className="last__td">{props.date}</td>
        </tr>
    );
}

export default Contact;
